import { React } from 'react';
import './UserForm.css'

const UserForm = () => {
    return (
        <form>
            div
            <label>Username</label>
            <input type='text'/>
            <label>Age (Years)</label>
            <input type='text' />
        </form>
    );
}

export default UserForm;
